import './index.css'

const Contact = () => (
  <div className="component-container">
    <img
      width={150}
      height={150}
      src="https://assets.ccbp.in/frontend/react-js/contact-blog-img.png "
      alt="contact"
    />
    <h1 className="nav-item-name">Contact</h1>
  </div>
)

export default Contact
